"""Untuk fitur numerik seperti 'age', 'bmi', dan 'children', standarisasi dilakukan menggunakan StandardScaler. Hal ini penting terutama untuk algoritma yang sensitif terhadap skala seperti Ridge Regression."""

# Tidak ada missing values, lanjut ke encoding

# Definisikan kolom kategorikal dan numerik
categorical_features = ['sex', 'smoker', 'region']
numeric_features = ['age', 'bmi', 'children']

# Buat preprocessor
preprocessor = ColumnTransformer(
    transformers=[
        ('num', StandardScaler(), numeric_features),
        ('cat', OneHotEncoder(drop='first'), categorical_features)
    ])

# Cek data outlier menggunakan metode IQR untuk variable target
Q1 = df['charges'].quantile(0.25)
Q3 = df['charges'].quantile(0.75)
IQR = Q3 - Q1

print("\nAnalisis Outlier pada Biaya Asuransi:")
